import axios from "axios";
import { useEffect, useState } from "react";
import { Dropdown } from "react-bootstrap";
import { Link } from "react-router-dom";
import authHeader from "../services/auth-header";
import "./manageclients.css";

function ManageClients() {
  const [clients, setClients] = useState([]);
  const URL_API_CLIENTS = "http://localhost:8090/api/clients/";
  const [filterVal, setFilterVal] = useState("");
  const [searchData, setSearchData] = useState([]);

  useEffect(() => {
    getAllClients();
  }, []);

  const getAllClients = () => {
    return axios
      .get(URL_API_CLIENTS, { headers: authHeader() })
      .then((response) => {
        setClients(response.data);
        setSearchData(response.data);
      });
  };

  const handleFilter = (e) => {
    if (e.target.value === "") {
      setClients(searchData);
    } else {
      const filterResult = searchData.filter((client) =>
        client.cnp.includes(e.target.value)
      );
      setClients(filterResult);
    }
    setFilterVal(e.target.value);
  };

  return (
    <>
     
     <div class="container">
      <div class="row">
        <div class="col-md-offset-1 col-md-10">
            <div class="panel">
                <div class="panel-heading">
                    <div class="row">
                        <div class="col col-sm-3 col-xs-12">
                            <h4 class="title">Data <span>List</span></h4>
                        </div>
                        <div class="col-sm-9 col-xs-12 text-right">
                            <div class="btn_group">
                                <input type="text" class="form-control" placeholder="Search"/>
                                <button class="btn btn-default" title="Reload"><i class="fa fa-sync-alt"></i></button>
                                <button class="btn btn-default" title="Pdf"><i class="fa fa-file-pdf"></i></button>
                                <button class="btn btn-default" title="Excel"><i class="fas fa-file-excel"></i></button>
                            </div>
                        </div>
                    </div>
                </div>
                <div class="panel-body">
        <table className=" table-bordered table-striped table-sm">
          <thead>
            <tr>
              <th>CNP</th>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Email</th>
              <th>Date Of Birth</th>
              <th>Gender</th>
              <th>Income</th>
              <th>Phone Number</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {clients.map((client) => (
              <tr key={client.id}>
                <td>{client.cnp}</td>
                <td>{client.user.firstName}</td>
                <td>{client.user.lastName}</td>
                <td>{client.user.email}</td>
                <td>{client.dob}</td>
                <td>{client.gender}</td>
                <td>{client.income}</td>
                <td>{client.phoneNumber}</td>
                <td id="actions">
                  <Dropdown>
                    <Dropdown.Toggle variant="info" id="dropdown-basic">
                      Actions
                    </Dropdown.Toggle>
                    <Dropdown.Menu>
                      <Dropdown.Item
                        variant="secondary"
                        href={`edit/${client.cnp}`}
                      >
                        Edit
                      </Dropdown.Item>
                      <Dropdown.Item href={`policies/${client.id}`}>
                        Policies
                      </Dropdown.Item>
                      <Dropdown.Item href={`claims/${client.id}`}>
                        Claims
                      </Dropdown.Item>
                    </Dropdown.Menu>
                  </Dropdown>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      </div>
      </div>
      </div>
      </div>
    </>
  );
}
export default ManageClients;
